--
-- Name: get_cvterm_id(character varying, character varying); Type: FUNCTION; Schema: public; Owner: gmod
--

CREATE FUNCTION get_cvterm_id(p_cv_name character varying, p_cvterm_name character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $$
   DECLARE
     ret_val INTEGER;
   BEGIN
     SELECT cvterm_id INTO ret_val FROM cvterm 
       INNER JOIN cv ON cvterm.cv_id = cv.cv_id 
       WHERE cv.name = p_cv_name AND cvterm.name = p_cvterm_name; 
--     IF NOT FOUND
--       RAISE EXCEPTION 'cv % and cvterm % not found', p_cv_name, p_cvterm_name;
--     END IF
     RETURN ret_val;
   END;
   $$;


ALTER FUNCTION public.get_cvterm_id(p_cv_name character varying, p_cvterm_name character varying) OWNER TO gmod;

--
-- Name: gwas_query(refcursor, integer, boolean); Type: FUNCTION; Schema: public; Owner: gmod
--

CREATE FUNCTION gwas_query(p_rc refcursor, p_proj_id integer, p_get_header boolean) RETURNS refcursor
    LANGUAGE plpgsql
    AS $$
  DECLARE
    v_plant_id INTEGER;
  BEGIN
    v_plant_id = get_cvterm_id('diversity_experiment', 'plant id');
    IF p_get_header THEN
      OPEN p_rc FOR
        SELECT 'experiment_id', 'genotype', 'plant_id', treatment_str,
	  phenotype_str
	  FROM gwas
          WHERE project_id = p_proj_id AND sp_type_id = v_plant_id
          LIMIT 1;
    ELSE
      OPEN p_rc FOR 
        SELECT nd_experiment_id, genotype, sp_value_id AS plant_id,
	  treatment_val, phenotype_val
          FROM gwas
          WHERE project_id = p_proj_id AND sp_type_id = v_plant_id;
    END IF;
  RETURN p_rc;
  END;
$$;


ALTER FUNCTION public.gwas_query(p_rc refcursor, p_proj_id integer, p_get_header boolean) OWNER TO gmod;

