--
-- Name: TABLE stockprop; Type: COMMENT; Schema: public; Owner: gmod
--

COMMENT ON TABLE stockprop IS 'A stock can have any number of slot-value property tags attached to it. This is an alternative to hardcoding a list of columns in the relational schema, and is completely extensible. There is a unique constraint, stockprop_c1, for the combination of stock_id, rank, and type_id. Multivalued property-value pairs must be differentiated by rank.';


--
-- Name: gwas; Type: VIEW; Schema: public; Owner: gmod
--

CREATE VIEW gwas AS
    SELECT ndep.nd_experiment_id, p.project_id, g.uniquename AS genotype, sp.type_id AS sp_type_id, sp.value AS sp_value_id, treatment.str AS treatment_str, treatment.val AS treatment_val, pheno.str AS phenotype_str, pheno.val AS phenotype_val FROM ((((((((project p JOIN nd_experiment_project ndep USING (project_id)) JOIN nd_experiment_stock ndes USING (nd_experiment_id)) JOIN stock s USING (stock_id)) JOIN stockprop sp USING (stock_id)) JOIN stock_genotype sg USING (stock_id)) JOIN genotype g USING (genotype_id)) JOIN (SELECT ndes.nd_experiment_stock_id, array_agg((SELECT cvterm.name FROM cvterm WHERE (cvterm.cvterm_id = ndes.type_id))) AS str, array_agg(ndes.value) AS val FROM nd_experiment_stockprop ndes WHERE (EXISTS (SELECT 1 FROM cvtermpath WHERE ((((cvtermpath.type_id = get_cvterm_id('relationship'::character varying, 'is_a'::character varying)) AND (cvtermpath.subject_id = ndes.type_id)) AND (cvtermpath.object_id = get_cvterm_id('diversity_experiment'::character varying, 'treatment'::character varying))) AND (cvtermpath.cv_id = (SELECT cv.cv_id FROM cv WHERE ((cv.name)::text = 'diversity_experiment'::text)))))) GROUP BY ndes.nd_experiment_stock_id) treatment USING (nd_experiment_stock_id)) JOIN (SELECT ndept.nd_experiment_id, array_agg((SELECT phenotype.uniquename FROM phenotype WHERE (phenotype.phenotype_id = ndept.phenotype_id))) AS str, array_agg(ndeptp.value) AS val FROM (nd_experiment_phenotype ndept JOIN nd_experiment_phenotypeprop ndeptp USING (nd_experiment_phenotype_id)) GROUP BY ndept.nd_experiment_id) pheno USING (nd_experiment_id)) ORDER BY ndep.nd_experiment_id;


ALTER TABLE public.gwas OWNER TO gmod;

