--
-- Name: TABLE phylonode; Type: COMMENT; Schema: public; Owner: gmod
--

COMMENT ON TABLE phylonode IS 'This is the most pervasive element in the phylogeny module, cataloging the "phylonodes" of tree graphs. Edges are implied by the parent_phylonode_id reflexive closure. For all nodes in a nested set implementation the left and right index will be *between* the parents left and right indexes.';


